import { Button, TextField, Typography } from '@mui/material';
import './App.css';

function App() {
  return (
    <div>
      <h1>Hello World !</h1>
      <TextField label='hi' placeholder='helo' variant='outlined' color='primary'>Hello</TextField>
      <Typography>Hello</Typography>
      <Button onClick={()=>{
        alert('hello')
      }} variant='contained' color='primary'>Submit</Button>
    </div>
  );
}

export default App;
